import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View, Image, TextInput, Button, TouchableOpacity } from 'react-native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import { NavigationContainer } from '@react-navigation/native';
import { Ionicons } from '@expo/vector-icons';
import { AntDesign } from '@expo/vector-icons';



export default function xacnhandonhang({ navigation }) {
    return (
        <View style={styles.container}>
            <View style={styles.thanhtren}>
                <TouchableOpacity onPress={() => navigation.navigate('goback')}>
                    <Ionicons name="chevron-back" size={24} color="black" />
                </TouchableOpacity>
                <View>
                    <Text style={styles.text}>XÁC NHẬN ĐƠN HÀNG</Text>
                </View>
            </View>
            <View style={{ width: 400, height: 1, marginTop: 5, backgroundColor: '#D8B2B2' }} />
            <Text style={{ marginLeft: 15, marginTop: 10, fontWeight: 'bold', }}>3.Phương thức thanh toán</Text>
            <View style={{ width: 400, height: 1, marginTop: 10, backgroundColor: '#D4CECE' }} />
            <View style={{ flexDirection: 'row', marginLeft: 20, marginTop: 10, }}>
                <Ionicons name="checkmark-circle" size={24} color="red" />
                <View>
                    <Text style={{ marginLeft: 10, marginTop: 5, }}>Thanh toán bằng VNPAY</Text>
                </View>
            </View>
            <View style={{ width: 400, height: 1, marginTop: 10, backgroundColor: '#D4CECE' }} />
            <View style={{ flexDirection: 'row', marginLeft: 20, marginTop: 10, }}>
                <Ionicons name="checkmark-circle" size={24} color="black" />
                <View>
                    <Text style={{ marginLeft: 10, marginTop: 5, }}>Thanh toán khi nhận hàng (COD)</Text>
                </View>
            </View>
            <View style={{ width: 400, height: 1, marginTop: 10, backgroundColor: '#D4CECE' }} />
            <View style={{}}>
                <Text style={{ fontWeight: 'bold', marginLeft: 20, marginTop: 10, }}>C-Point</Text>
            </View>
            <View style={{ width: 400, height: 1, marginTop: 10, backgroundColor: '#D4CECE' }} />
            <View style={{ flexDirection: 'row' }}>
                <Text style={{ marginLeft: 20, marginTop: 10, }}>C-Point khả dụng</Text>
                <View style={{ marginLeft: 5, marginTop: 9, }}><AntDesign name="infocirlceo" size={14} color="black" /></View>
            </View>
            <View>
            <TextInput
            placeholder="Email ID/Mobie Number"
            keyboardType="default"
          />
            </View>



        </View>
    );
}

const Stack = createNativeStackNavigator();

const styles = StyleSheet.create({
    container: {
        marginTop: 30,

    },
    thanhtren: {
        flexDirection: 'row',
        marginLeft: 10,
    },
    text: {
        marginLeft: 90,
        marginTop: 2,
        fontWeight: 'bold',
    },

})
